import './Nav.css'
import { NavLink } from 'react-router-dom';
const Nav = () => {
    return (
        <div>
            <ul>
                <li><NavLink to="/news">News</NavLink></li>
                <li><NavLink to="/contact">Contact</NavLink></li>
                <li><NavLink to="/about">About</NavLink></li>
                <li><NavLink exact="true" to="/">Home</NavLink></li>
            </ul>
        </div>
    );
  }
  
  export default Nav;
